import React from 'react';
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types';

const Film = ({
  film: {
  title,
  date,
  image,
  cinema,
  ticketPrice,
  crowdfundTarget,
  totalsoFar
  }
}) => {
  return (
    <div className='profile bg-light'>
      <div>
        <h2>{title}</h2>
        <i>
          {image}
        </i>
        <p className='my-1'><span>{cinema}</span></p>
        <p className='my-1'><span>{ticketPrice}</span>}</p>
        <p className='my-1'><span>{crowdfundTarget}</span>}</p>
        <p className='my-1'><span>{`${totalsoFar}`}</span>}</p>
      </div>
    </div>
  );
};

Film.propTypes = {
  film: PropTypes.object.isRequired
};

export default Film;
